var app = angular.module('app', []);

app.directive("paster", function () {
	return function (scope, element, attrs) {
		element.on('paste', function (e) {
			console.log(e);
		});

		element[0].addEventListener('paste', function (evt) {
			var files = [];
			var clipboard = evt.clipboardData || evt.originalEvent.clipboardData;
			if (clipboard && clipboard.items) {
				for (var k = 0; k < clipboard.items.length; k++) {
					if (clipboard.items[k].type.indexOf('image') !== -1) {
						files.push(clipboard.items[k].getAsFile());
					}
				}
			}

			console.log(files);
		});

		triggerPaste(element[0]);
	}
});

function triggerPaste(element, data, type) {
	data = '';
	type = 'image/jpeg';

	simulateClick(base64toBlob(data, type), element);
}

function base64toBlob(base64Data, contentType) {
	contentType = contentType || '';
	var sliceSize = 1024;
	var byteCharacters = atob(base64Data);
	var bytesLength = byteCharacters.length;
	var slicesCount = Math.ceil(bytesLength / sliceSize);
	var byteArrays = new Array(slicesCount);

	for (var sliceIndex = 0; sliceIndex < slicesCount; ++sliceIndex) {
		var begin = sliceIndex * sliceSize;
		var end = Math.min(begin + sliceSize, bytesLength);

		var bytes = new Array(end - begin);
		for (var offset = begin, i = 0; offset < end; ++i, ++offset) {
			bytes[i] = byteCharacters[offset].charCodeAt(0);
		}
		byteArrays[sliceIndex] = new Uint8Array(bytes);
	}
	return new Blob(byteArrays, {type: contentType});
}

function simulateClick(data, element) {
	var event = new KeyboardEvent('paste', {
		ctrlKey: true,
		code: 99,
		isComposing: true
	});

	event.clipboardData = {
		items: [{
			getAsFile: function () {
				return data;
			},
			type: "image/png"
		}]
	};

	element.dispatchEvent(event);
}
